INSERT INTO `bookstore` VALUES ('《白鹿原》 ',' 陈忠实','这是一部中国现代文学巨著，讲述了白鹿原上几代人的兴衰史，反映了中国农村社会的变迁和人性的善恶。','文学与艺术','文学小说','0002',10),('《围城》 ',' 钱钟书','这是一部中国现代文学名著，以讽刺的笔调描绘了中国封建社会的婚姻观念和知识分子的困境，反映了20世纪中国社会的封闭与变革。','文学与艺术','文学小说','0003',10),('《红楼梦》 ',' 曹雪芹','这是一部中国古典文学巨著，描绘了贾宝玉等人物在红楼的生活和情感纠葛，反映了封建社会的荣辱兴衰和人性的复杂。','文学与艺术','文学小说','0004',10),('《平凡的世界》 ',' 路遥','这是一部中国现实主义小说，描绘了中国社会主义改革开放时期的社会变革和人物命运，反映了中国农村的生活与命运。','文学与艺术','文学小说','0005',10),('《茶馆》','郁达夫','这是一部中国现代戏剧作品，以茶馆为背景，展现了中国社会的种种现象和人物命运，反映了中国近现代社会的沧桑和变迁。','文学与艺术','文学小说','0006',10),('《草鞋湾》 ',' 芥川龙之介','这是一部日本短篇小说集，以草鞋湾为背景，描绘了人物的内心世界和社会的种种现象，反映了日本社会的传统与现代的碰撞。','文学与艺术','文学小说','0007',10),('《麦田里的守望者》 ',' J·D·塞林格','这是一部美国文学经典，讲述了少年霍尔顿在纽约的经历和对社会的反思，反映了美国战后社会的青少年心态和社会现实。','文学与艺术','文学小说','0008',10),('《追风筝的人》 ',' 卡勒德·胡赛尼','这是一部描写阿富汗历史与现实的小说，以风筝为象征，讲述了两个少年之间友情与背叛的故事，反映了阿富汗社会的变迁和挣扎。','文学与艺术','文学小说','0009',10),('《1984》 ',' 乔治·奥威尔','这是一部反乌托邦小说，描绘了一个极权主义统治下的虚构社会，通过对权力、自由和个人权利的思考，警示人们对权力的滥用和个人自由的珍视。','文学与艺术','文学小说','0010',10),('《小王子》 ',' 安托万·德·圣埃克苏佩里','这是一部法国文学经典，以童话的形式讲述了小王子在宇宙中的冒险经历，探讨了友谊、责任和人生意义等深刻主题。','文学与艺术','文学小说','0011',10),('《三体》 ',' 刘慈欣','这是一部中国科幻小说，讲述了地球人类与外星文明三体人之间的对抗与交流，充满了科幻想象和哲学思考。','文学与艺术','文学小说','0012',10),('《巴黎圣母院》 ',' 维克多·雨果','这是一部法国文学经典，以巴黎圣母院为背景，讲述了钟楼魔王和吉斯蒂安的故事，描绘了中世纪巴黎的风情和社会阶层。','文学与艺术','文学小说','0013',10),('《傲慢与偏见》 ',' 简·奥斯汀','这是一部英国文学经典，讲述了伊丽莎白·班内特与达西先生之间的爱恨情仇，反映了19世纪英国上层社会的习俗与偏见。','文学与艺术','文学小说','0014',10),('《人间失格》 ',' 太宰治','这是一部日本文学作品，通过主人公太宰治的自述，揭示了他内心的矛盾与挣扎，反映了日本战后社会的精神困境和人性的复杂性。','文学与艺术','文学小说','0015',10),('《天才在左 疯子在右》 ',' 高铭','这是一部心理学类图书，作者通过自身的经历和对人生的思考，探讨了天才与疯子之间的微妙边界和人性的多重面貌。','文学与艺术','文学小说','0016',10),('《月亮与六便士》 ',' 威廉·萨默塞特·毛姆','这是一部英国文学作品，灵感来源于画家高更的生平，讲述了画家查尔斯·斯特雷特的人生追求和对艺术的追求，反映了艺术与生活的冲突与融合。','文学与艺术','文学小说','0017',10),('《活着写给儿子的信》 ',' 顾城','这是一部中国现代散文集，作者以父亲的身份写给儿子的信，表达了对生活、家庭和社会的思考和感悟，温情感人。','文学与艺术','文学小说','0018',10),('《飘》 ',' 玛格丽特·米切尔','这是一部美国文学经典，讲述了南北战争时期南方贵族斯佳丽的爱情与人生，描绘了南方社会的风土人情和战争的残酷。','文学与艺术','文学小说','0019',10),('《一九八四》 ',' 乔治·奥威尔','这是一部反乌托邦小说，描绘了一个极权主义统治下的虚构社会，通过对权力、自由和个人权利的思考，警示人们对权力的滥用和个人自由的珍视。','文学与艺术','文学小说','0020',10),('《罗生门》 ',' 芥川龙之介','这是一部日本文学作品，以短篇小说形式展现了各种人性的阴暗面和道德困境，探讨了真相与虚假之间的辩证关系。','文学与艺术','文学小说','0021',10),('《雾都孤儿》 ',' 查尔斯·狄更斯','这是一部英国文学经典，描绘了维多利亚时代伦敦的社会底层生活和孤儿奥利弗的命运，反映了19世纪英国社会的贫富差距和社会问题。','文学与艺术','文学小说','0022',10),('《霍乱时期的爱情》 ',' 加西亚·马尔克斯','这是一部南美文学巨著，讲述了主人公费洛梅娜和富兰克林之间跨越时空的爱情故事，充满了魔幻现实主义的色彩。','文学与艺术','文学小说','0023',10),('《一个陌生女人的来信》 ',' 斯蒂芬·茨威格','这是一部奥地利文学作品，讲述了主人公阿尔贝特与一个陌生女人之间的爱情故事，揭示了命运的无常和人生的追求。','文学与艺术','文学小说','0024',10),('《茶花女》 ',' 亚历山大·仲马','这是一部法国文学名著，讲述了巴黎名妓玛格丽特的爱情悲剧，反映了19世纪法国社会的道德沦丧和个人命运的悲剧。','文学与艺术','文学小说','0025',10),('《倾城之恋》 ',' 金庸','这是一部中国武侠小说，以历史上的真实事件为背景，讲述了梁山伯与祝英台的爱情故事，被誉为中国四大爱情传说之一。','文学与艺术','文学小说','0026',10),('《少年维特的烦恼》 ',' 歌德','这是一部德国文学作品，讲述了主人公维特的青春成长和对爱情的追求，反映了德国浪漫主义文学的精神追求和个人内心的挣扎。','文学与艺术','文学小说','0027',10),('《理智与情感》 ',' 简·奥斯汀','这是一部英国文学经典，描绘了两姐妹的爱情与婚姻故事，反映了19世纪英国社会的婚姻观念和女性地位。','文学与艺术','文学小说','0028',10),('《大卫·科波菲尔》 ',' 查尔斯·狄更斯','这是一部英国文学经典，讲述了主人公大卫·科波菲尔的成长历程和对生活的追求，反映了19世纪英国社会的阶级差距和人性的善恶。','文学与艺术','文学小说','0029',10),('《麦田守望者》 ',' J·D·塞林格','这是一部美国文学经典，以少年霍尔顿的视角描绘了他在纽约的经历和对社会的反思，反映了美国战后社会的青少年心态和社会现实。','文学与艺术','文学小说','0030',10),('《悲惨世界》 ',' 维克多·雨果','这是一部法国文学巨著，描绘了法国社会的贫困、不公和革命斗争，以及主人公让·瓦尔简的复仇与救赎之路。','文学与艺术','文学小说','0031',10),('《尤利西斯》 ',' 詹姆斯·乔伊斯','这是一部爱尔兰现代主义文学作品，以一天内主人公布鲁姆和斯蒂芬的经历为线索，探讨了人生、文化和历史的多重意义。','文学与艺术','文学小说','0032',10),('《哈姆雷特》 ',' 威廉·莎士比亚','这是一部英国文学经典，讲述了丹麦王子哈姆雷特为父报仇的故事，揭示了人性的复杂和命运的无常。','文学与艺术','文学小说','0033',10),('《基督山伯爵》 ',' 大仲马','这是一部法国文学经典，讲述了主人公爱德蒙·唐泰斯的复仇之路，描绘了19世纪法国社会的黑暗与光明。','文学与艺术','文学小说','0034',10),('《老人与海》 ',' 海明威','这是一部美国文学经典，讲述了古巴老渔夫桑地亚哥与巨大的马林鱼之间的生死较量，反映了人与自然的关系和人生的意义。','文学与艺术','文学小说','0035',10),('《战争与和平》 ',' 列夫·托尔斯泰','这是一部俄国文学巨著，描绘了拿破仑战争时期俄国社会的军事、政治和家庭生活，反映了人性的善恶和历史的发展。','文学与艺术','文学小说','0036',10),('《呼啸山庄》 ',' 艾米莉·勃朗特','这是一部英国文学经典，描绘了希斯克利夫和凯瑟琳之间的爱恨情仇，反映了19世纪英国北部乡村的风土人情和家族恩怨。','文学与艺术','文学小说','0037',10),('《钢琴师》 ',' 埃尔米·安贝尔','这是一部意大利文学作品，讲述了主人公莫拉西尼在二战后意大利的生活和音乐追求，反映了战后意大利社会的动荡和复兴。','文学与艺术','文学小说','0038',10),('《安娜·卡列尼娜》 ',' 列夫·托尔斯泰','这是一部俄国文学经典，讲述了主人公安娜与文托夫之间的婚外情和悲剧结局，揭示了俄国贵族社会的道德沦丧和个人命运的无奈。','文学与艺术','文学小说','0039',10),('《金瓶梅》 ',' 兰陵笑笑生','这是一部中国古典文学作品，以明代社会为背景，描绘了潘金莲等人物的世俗生活和情感纠葛，反映了封建社会的风尚和人性的善恶。','文学与艺术','文学小说','0040',10),('《天龙八部》 ',' 金庸','这是一部中国武侠小说，讲述了宋朝末年的江湖恩怨和英雄豪情，以及主人公段誉的成长和江湖历程。','文学与艺术','文学小说','0041',10),('《百年孤独》 ',' 加西亚·马尔克斯','这是一部哥伦比亚文学巨著，描绘了布恩迪亚家族七代人的传奇故事，反映了拉丁美洲的历史、文化和人性。','文学与艺术','文学小说','0042',10),('《尘埃落定》 ',' 阿列克谢·托尔斯泰','这是一部俄罗斯文学作品，讲述了主人公谢尔盖与德米娜之间的爱情故事，揭示了俄罗斯社会的道德困境和人性的美好。','文学与艺术','文学小说','0043',10),('《海边的卡夫卡》 ',' 村上春树','这是一部日本现代文学作品，描绘了主人公加寿子的成长历程和对人生的思考，反映了现代日本社会的空虚和迷茫。','文学与艺术','文学小说','0044',10),('《无人生还》 ',' 阿加莎·克里斯蒂','这是一部英国侦探小说，讲述了一群人在孤岛上被杀害的故事，通过侦探波洛的推理，揭示了每个人之间的关系和动机。','文学与艺术','文学小说','0045',10),('《夏洛的网》 ',' E·B·怀特','这是一部美国儿童文学经典，讲述了小猪威尔伯和蜘蛛夏洛的友情故事，描绘了农村生活的乐趣和友情的力量。','文学与艺术','文学小说','0046',10),('《呼啸山庄》 ',' 艾米莉·勃朗特','这是一部英国文学经典，描绘了希斯克利夫和凯瑟琳之间的爱恨情仇，反映了19世纪英国北部乡村的风土人情和家族恩怨。','文学与艺术','文学小说','0047',10),('《人类群星闪耀时》 ',' 斯蒂芬·茨威格','这是一部德国文学作品，描绘了主人公理查德的人生历程和对自由的追求，反映了20世纪欧洲社会的动荡和人性的复杂。','文学与艺术','文学小说','0048',10),('《芳华》 ',' 严歌苓','这是一部中国文学作品，描绘了文化大革命时期的知青生活和情感纠葛，反映了那个特殊时期的社会变革和个人成长。','文学与艺术','文学小说','0049',10),('《约翰·克里斯朵夫》 ',' 塞尔·西尔维奥·德·布莱斯','这是一部法国文学作品，讲述了约翰·克里斯朵夫的生平和对艺术的追求，反映了19世纪法国社会的艺术氛围和人性的探索。','文学与艺术','文学小说','0050',10),('《挪威的森林》 ',' 村上春树','这是一部日本现代文学作品，描写了主人公渡边以及他与两位女性之间的情感纠葛，反映了现代都市青年的孤独和迷茫。','文学与艺术','文学小说','0051',10),('《暮光之城》 ',' 斯蒂芬妮·梅尔','这是一部美国青少年小说系列，讲述了人类少女贝拉与吸血鬼爱德华之间的爱情故事，探讨了爱与永恒的主题。','文学与艺术','文学小说','0052',10),('《穆斯林的葬礼》 ',' 霍达','这是一部英国文学作品，描绘了主人公奥马尔回到英国参加父亲的葬礼后的遭遇，反映了穆斯林在西方社会的生存境遇和文化冲突。','文学与艺术','文学小说','0053',10),('《遥远的救世主》 ',' 鲁迅','这是一部中国现代文学作品，讲述了一个民间传说中的故事，反映了中国人民对解救的向往和对社会现实的关切。','文学与艺术','文学小说','0054',10),('《一个陌生女人的来信》 ',' 斯蒂芬·茨威格','这是一部奥地利文学作品，讲述了主人公阿尔贝特与一个陌生女人之间的爱情故事，揭示了命运的无常和人生的追求。','文学与艺术','文学小说','0055',10),('《荒原》 ',' 莫泊桑','这是一部法国文学作品，以短篇小说的形式描绘了法国农村的生活和人物命运，反映了19世纪法国社会的阶级矛盾和人性的善恶。','文学与艺术','文学小说','0056',10),('《基督山伯爵》 ',' 大仲马','这是一部法国文学经典，讲述了主人公爱德蒙·唐泰斯的复仇之路，描绘了19世纪法国社会的黑暗与光明。','文学与艺术','文学小说','0057',10),('《摆渡人》 ',' 格尔·菲利普斯','这是一部美国小说，讲述了主人公米克的心路历程和对生命的思考，反映了人生的苦难与挣扎。','文学与艺术','文学小说','0058',10),('《麦琪的礼物》 ',' 威廉·萨默塞特·毛姆','这是一部英国文学作品，讲述了主人公麦琪与她的情人之间的爱情