',' 张爱玲','这是一部中国现代文学作品，讲述了女主人公王薇薇的爱情经历和婚姻观念，反映了中国现代女性的心理和生活状态。','文学与艺术','文学小说','0079',10),('《月亮与六便士》 ',' 威廉·萨默塞特·毛姆','这是一部英国文学作品，受到画家保罗·高更生平的启发，讲述了一个中年银行家梅瑟斯的冒险之旅，揭示了艺术与生活、理想与现实之间的矛盾与冲突。','文学与艺术','文学小说','0080',10),('《爱的教育》 ',' 埃德蒙·罗斯坦','这是一部法国浪漫主义小说，讲述了一个年轻的贵族弗朗茨与一个寡妇黛米娜之间的爱情故事，揭示了爱情与社会阶层之间的冲突与隔阂。','文学与艺术','文学小说','0081',10),('《雪山飞狐》 ',' 金庸','这是一部中国武侠小说，讲述了主人公胡斐的江湖行走和爱恨情仇，描绘了金庸笔下的武侠世界。','文学与艺术','文学小说','0082',10),('《阿拉伯的劳伦斯》 ',' 乔治·奥威尔','这是一部英国文学作品，讲述了主人公劳伦斯在阿拉伯地区的冒险经历和对帝国主义的批判，揭示了殖民主义的黑暗面和人性的复杂。','文学与艺术','文学小说','0083',10),('《傲慢与偏见》 ',' 简·奥斯汀','这是一部英国文学经典，讲述了伊丽莎白·班内特和达西先生之间的爱情故事，反映了19世纪英国乡村社会的风俗习惯和人性特点。','文学与艺术','文学小说','0084',10),('《东方快车谋杀案》 ',' 阿加莎·克里斯蒂','这是一部英国侦探小说，讲述了在东方快车上发生的一桩谋杀案，通过侦探波洛的推理，揭示了案件的真相和凶手的身份。','文学与艺术','文学小说','0085',10),('《钟鼓楼》 ',' 丰子恺','这是一部中国文学作品，以丰子恺在北京西城的居所为背景，描绘了他的生活和创作情况，反映了当时的社会风貌和人文精神。','文学与艺术','文学小说','0086',10),('《侠客行》 ',' 金庸','这是一部中国武侠小说，讲述了主人公郭靖和黄蓉的江湖传奇，描绘了金庸笔下的侠客世界和江湖恩怨。','文学与艺术','文学小说','0087',10),('《老人与海》 ',' 海明威','这是一部美国文学经典，讲述了老渔夫圣地亚哥与他与大马林鱼的搏斗，以及对生命和命运的思考，是海明威创作的代表作之一。','文学与艺术','文学小说','0088',10),('《天涯孤影》 ',' 二月河','这是一部中国当代文学作品，以明朝开国皇帝朱元璋的故事为背景，描绘了他的政治生涯和个人命运，反映了中国古代社会的政治斗争和人性百态。','文学与艺术','文学小说','0089',10),('《无声告白》 ',' 伍绮诗','这是一部香港文学作品，描绘了主人公吴佩珊的成长历程和家庭矛盾，反映了香港社会的变革和女性的命运。','文学与艺术','文学小说','0090',10),('《嫌疑人X的献身》 ',' 东野圭吾','这是一部日本推理小说，讲述了数学天才石神和他对邻居毛利的深情爱意，以及为了保护她而进行的精密犯罪，是东野圭吾的代表作之一。','文学与艺术','文学小说','0091',10),('《鹿鼎记》 ',' 金庸','这是一部中国武侠小说，讲述了康熙年间的江湖恩怨和朝野纷争，是金庸创作的经典之一，描绘了金庸笔下的江湖世界和皇宫内斗。','文学与艺术','文学小说','0092',10),('《红楼梦》 ',' 曹雪芹','这是一部中国古典文学巨著，描绘了贾宝玉和林黛玉之间的爱情故事，反映了中国封建社会的荣辱兴衰和人情世故。','文学与艺术','文学小说','0093',10),('《封神榜》 ',' 无名氏','这是一部中国古典神话小说，描绘了商朝后期姜子牙辅佐周武王平定蛮夷的故事，反映了中国古代神话中的英雄豪杰和神话传说。','文学与艺术','文学小说','0094',10),('《沉默的大多数》 ',' 王小波','这是一部中国当代文学作品，是王小波的代表作之一，通过小说揭示了中国现代社会中人们内心的沉默和无奈，对社会现实进行了深刻的讽刺和批判。','文学与艺术','文学小说','0095',10),('《巴黎圣母院》 ',' 维克多·雨果','这是一部法国文学经典，讲述了巴黎圣母院钟楼巴西莫多的丑角和爱斯梅拉达的爱情故事，反映了中世纪欧洲社会的宗教信仰和人性的悲剧。','文学与艺术','文学小说','0096',10),('123','123','123','历史与地理','历史与地理','0002',10),('4565','456','456','历史与地理','历史与地理','0004',10);
